var esq = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "GenRealtySection");
var priceColumn = esq.AddColumn("GenPrice");
var areaColumn = esq.AddColumn("GenArea");

var realtyTypeId = Get<Guid>("GenRealtyTypeIdParameter");
var offerTypeId = Get<Guid>("GenOfferTypeIdParameter");

esq.Filters.Add(esq.CreateFilterWithParameters(FilterComparisonType.Equal, "GenType", realtyTypeId));
esq.Filters.Add(esq.CreateFilterWithParameters(FilterComparisonType.Equal, "GenOfferType", offerTypeId));

var entityCollection = esq.GetEntityCollection(UserConnection);
decimal totalPrice = 0.0M;
decimal totalArea = 0.0M;

foreach(var entity in entityCollection) {
	totalPrice += entity.GetTypedColumnValue<decimal>(priceColumn.Name);
	totalArea += entity.GetTypedColumnValue<decimal>(areaColumn.Name);
}

Set("GenCalculatedAvgPrice", totalArea > 0 ? totalPrice / totalArea : 0.0M);

return true;
